import React from "react";
import Orb from "./Orb";
import CardNav from "./CardNav"; // <-- import your CardNav
import logo from "./logo.png";   // <-- use your own logo

function Landing() {
  const handleLogin = () => {
    // Redirect to Flask backend for Google OAuth
    window.location.href = "http://localhost:5000/auth/login";
  };

  const goToChat = () => {
    window.location.href = "/chat";
  };

  // CardNav items
  const navItems = [
    {
      label: "About",
      bgColor: "#0D0716",
      textColor: "#fff",
      links: [
        { label: "Company", ariaLabel: "About Company", href: "/company" },
        { label: "Careers", ariaLabel: "About Careers", href: "/careers" },
      ],
    },
    {
      label: "Projects",
      bgColor: "#170D27",
      textColor: "#fff",
      links: [
        { label: "Featured", ariaLabel: "Featured Projects", href: "/featured" },
        { label: "Case Studies", ariaLabel: "Project Case Studies", href: "/case-studies" },
      ],
    },
    {
      label: "Contact",
      bgColor: "#271E37",
      textColor: "#fff",
      links: [
        { label: "Email", ariaLabel: "Email us", href: "mailto:info@example.com" },
        { label: "Twitter", ariaLabel: "Twitter", href: "https://twitter.com" },
        { label: "LinkedIn", ariaLabel: "LinkedIn", href: "https://linkedin.com" },
      ],
    },
  ];

  return (
    <div className="landing-page">
      {/* Orb Background */}
      <div className="orb-wrapper">
        <Orb
          hoverIntensity={0.4}
          rotateOnHover={true}
          hue={200}
          forceHoverState={false}
        />
      </div>

      {/* Math Background */}
      <div className="math-background">
        {Array.from({ length: 50 }).map((_, i) => (
          <span
            key={i}
            className="math-symbol"
            style={{
              "--x": Math.random(),
              "--y": Math.random(),
              animationDuration: `${10 + Math.random() * 20}s`,
              fontSize: `${1 + Math.random() * 2}rem`,
            }}
          >
            {["∑", "√", "π", "∞", "∫", "∆", "≈", "∇"][i % 8]}
          </span>
        ))}
      </div>

      {/* Card Navigation (top center) */}
      <CardNav
  logo={logo}
  logoAlt="MathNarrator Logo"
  items={navItems}
  baseColor="rgba(255, 255, 255, 0.1)" // transparent white
  menuColor="#000"
  buttonBgColor="#fff"
  buttonTextColor="#fff"
  ease="power3.out"
/>


      {/* Main Content */}
      <main class="main-content">
  {/* Add this div for the glowing orb */}
  <div class="orb-background"></div>

  <div class="hero-section">
    <h1 class="hero-title">
      Math<span class="highlight">Narrator</span>
    </h1>
    <p class="hero-subtitle">
      A Deep-Dive into contextual scenario generation from mathematical
      expressions
    </p>

    {/* Buttons */}
    <div class="cta-buttons">
      <button class="btn-primary" onClick={handleLogin}>
        <span>Sign in with Google</span>
        <div class="btn-shine"></div>
      </button>

      <button class="btn-secondary" onClick={goToChat}>
        Open Chat <span class="arrow">→</span>
      </button>
    </div>
  </div>
</main>

      {/* Styles */}
      <style jsx="true">{`
        .landing-page {
          position: fixed;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
          background: #000;
          color: #fff;
          font-family: "Helvetica Neue", Arial, sans-serif;
          overflow: hidden;
          margin: 0;
          padding: 0;
        }

        /* Orb layer */
        .orb-wrapper {
          position: fixed;
          top: 0;
          left: 0;
          width: 100vw;
          height: 100vh;
          z-index: 1;
          pointer-events: none;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        /* Math symbols */
        .math-background {
          position: absolute;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
          overflow: hidden;
          z-index: 0;
        }
        .math-symbol {
          position: absolute;
          font-size: 1.5rem;
          opacity: 0.15;
          animation: float 20s linear infinite;
          left: calc(100% * var(--x, 0));
          top: calc(100% * var(--y, 0));
        }
        @keyframes float {
          from {
            transform: translateY(100vh) rotate(0deg);
          }
          to {
            transform: translateY(-100vh) rotate(360deg);
          }
        }

        /* Content */
        .main-content {
          position: relative;
          z-index: 10;
          display: flex;
          align-items: center;
          justify-content: center;
          min-height: 100vh;
          text-align: center;
          padding: 2rem;
        }

        .hero-section {
          animation: fadeInUp 1.5s ease forwards;
          opacity: 0;
        }
        @keyframes fadeInUp {
          from {
            opacity: 0;
            transform: translateY(40px);
          }
          to {
            opacity: 1;
            transform: translateY(0);
          }
        }

        .hero-title {
          font-size: clamp(2.5rem, 5vw, 4rem);
          font-weight: 800;
          margin-bottom: 1rem;
        }

        .highlight {
          color: #00e5ff;
          text-shadow: 0 0 15px rgba(0, 229, 255, 0.8);
        }

        .hero-subtitle {
          font-size: clamp(1rem, 2vw, 1.5rem);
          margin-bottom: 2.5rem;
          color: #bbb;
          line-height: 1.6;
        }

        /* Buttons */
        .cta-buttons {
          display: flex;
          gap: 1rem;
          justify-content: center;
          flex-wrap: wrap;
        }

        .btn-primary {
          position: relative;
          padding: 0.85rem 1.75rem;
          border-radius: 10px;
          font-weight: 600;
          color: #000;
          background: #fff;
          overflow: hidden;
          cursor: pointer;
          transition: all 0.3s ease;
          box-shadow: 0 0 10px rgba(255, 255, 255, 0.3);
        }
        .btn-primary:hover {
          transform: translateY(-3px);
          box-shadow: 0 0 20px rgba(255, 255, 255, 0.5);
        }
        .btn-shine {
          position: absolute;
          top: 0;
          left: -75%;
          width: 50%;
          height: 100%;
          background: linear-gradient(
            120deg,
            transparent,
            rgba(255, 255, 255, 0.6),
            transparent
          );
          transform: skewX(-20deg);
          animation: shine 2s infinite;
        }
        @keyframes shine {
          0% {
            left: -75%;
          }
          100% {
            left: 125%;
          }
        }

        .btn-secondary {
          padding: 0.85rem 1.75rem;
          border-radius: 10px;
          font-weight: 600;
          background: transparent;
          border: 2px solid #fff;
          color: #fff;
          cursor: pointer;
          transition: all 0.3s ease;
        }
        .btn-secondary:hover {
          background: #fff;
          color: #000;
        }
        .arrow {
          margin-left: 0.5rem;
          transition: transform 0.3s ease;
        }
        .btn-secondary:hover .arrow {
          transform: translateX(5px);
        }
      `}</style>
    </div>
  );
}

export default Landing;
